import React, { useState } from 'react';

/*
    부모가 자식한테 값을 보낼때 매개변수를 통해서 보낸다.
    props -> JSON 객체
*/
function Appclass2(props) {
  //useState(변수의 초기값)
  const [name, setName] = useState('홍길동');
  const [age, setAge] = useState(23);
  const { title, address } = props;

  return (
    <div>
      <h1>{title}</h1>
      <h3>이름 : {name}</h3>
      <h3>나이 : {age}</h3>
      <h3>주소 : {address}</h3>
    </div>
  );
}

export default Appclass2;
